//SPDX-License-Identifier: MIT

pragma solidity 0.7.5;
pragma abicoder v2;

import "./utils/SafeMath.sol";
import "./utils/Ownable.sol";
import "./ERC666.sol";


contract EquipmentFactory is Ownable, ERC666{
    using SafeMath for uint256;


    struct Gear {
        uint id; 
        uint rarity;
        uint gearType; // 1 ou 2:  armes ou armures
        uint[] skills;
        uint[5] stats;
        string name;
        string urlPng;
        // address owner;
    }
    
    Gear[] public gears;

    function getStatGear(uint _id, uint _stat) public view returns (uint){
        return gears[findSpecificID(_id)].stats[_stat];
    }
    

/////////////////////
//////IDs stuff//////
/////////////////////

    function findNewID() public view returns (uint){
        uint bigId;
        if (gears.length==0){
            return 0;
        }
        for (uint i=0; i<gears.length; i++){ 
            if (gears[i].id >bigId){
                bigId=gears[i].id;
            } 
        }
        return bigId+1 ;
    }

    function findSpecificID(uint _id) public view returns (uint number){
        for (uint i=0; i<gears.length; i++){
            if (gears[i].id ==_id){
                return i;
            } 
        }
        return 0;
    }

//////////////////////
/////create stuff/////
//////////////////////

    function newGear (string memory _name, uint _gearType, uint[] memory _skills, uint _rarity, string memory _urlPng, uint _HP, uint _Attack, uint _HC, uint _Agility, uint _Def) internal view returns (Gear memory) {
        
        Gear memory g;
        g.name = _name;
        g.gearType= _gearType;
        g.skills=_skills;
        g.urlPng=_urlPng;
        g.id=findNewID();
        g.rarity=_rarity;

        g.stats[0] = _HP;
        g.stats[1] = _Attack;
        g.stats[2] = _HC;
        g.stats[3] = _Agility;
        g.stats[4] = _Def;

        return g;
    }

    function pushAGear (Gear memory _g) internal returns (uint){
        gears.push(_g);
        uint id= _g.id;
        return id;
    }

    function createOneGear (string memory _name, uint _gearType, uint[] memory _skills, uint _rarity, string memory _urlPng, uint _HP, uint _Attack, uint _HC, uint _Agility, uint _Def, address _owner) internal {
        Gear memory g= newGear(_name, _gearType, _skills, _rarity, _urlPng, _HP, _Attack, _HC, _Agility, _Def);
        g.id= pushAGear(g);
        _mint( _NFT,_categoryNFTgear , _owner, 1);
        // addToPossession(_categoryNFT, id, _Owner);
    }

    function createBatchSameGear(string memory _name, uint _gearType, uint[] memory _skills, uint _rarity, string memory _urlPng, uint _HP, uint _Attack, uint _HC, uint _Agility, uint _Def, uint _amount) internal returns (uint) {
        Gear memory g = newGear(_name, _gearType, _skills, _rarity, _urlPng, _HP, _Attack, _HC, _Agility, _Def);
        uint id=pushAGear(g);
        _mint( _SFT, id, address(this), _amount);        
        return id;
    }

////////////////////
/////burn stuff/////
////////////////////


    function burnGear(uint _id, address _owner) internal {
        // require (balanceOf(_NFT,_id)==1, "tu ne possedes pas cet objet");
        uint number= findSpecificID(_id);
        if(number==0){
            revert("il n'y a pas dobjet a cet id");
        }
        gears[number] = gears[gears.length-1];
        gears.pop();
        _burn( _NFT, _categoryNFTgear, _owner, 1);
        // removeFromPossession(_categoryNFT, _id, _owner);
    }

    function burnBatchGear(uint[] memory _ids, address _owner)internal{
        for (uint i=0; i<_ids.length; i++ ){
            if(balanceOf(_NFT, _ids[i])!=1){
                revert("vous ne possedez pas un de ces objets");  // changer, le require devra se trouver dans la fonction external
            }
        }
        for (uint i=0; i<_ids.length; i++ ){
            burnGear(_ids[i], _owner);
        }
    }

    function burnBatchGearSFT(uint _id, uint _amount)internal{
        require (balanceOf(_SFT, _id)>=_amount,"tu ne peux pas burn autant de SFT");
        _burn( _SFT, _categorySFTgear, address(this) , _amount);
    }

////////////////////////
/////crafting stuff/////
////////////////////////


    function getCraftTokenToGive(uint _id) internal view returns (uint value){

        uint id=findSpecificID(_id);
        if(id==0){
            revert("il n'y a pas dobjet a cet id");
        }

        if(gears[id].rarity==0){
            return 2;
        } else if(gears[id].rarity == 1){
            return 5;
        } else if(gears[id].rarity == 2){
            return 15;
        } else if(gears[id].rarity == 3){
            return 40;
        } else if(gears[id].rarity == 4){
            return 100;
        }
    }

    function getBatchCraftTokenToGive(uint[] memory _ids)internal view returns (uint){
        uint total;
        for (uint i=0; i<_ids.length; i++ ){
            total=total.add(getCraftTokenToGive(_ids[i]));
        }
        return total;
    }

    function decraftGears(uint[] memory _ids) public {
        uint totalCraftTokenToGive= getBatchCraftTokenToGive(_ids);
        burnBatchGear(_ids, msg.sender);
        _mint(0, 0, msg.sender , totalCraftTokenToGive); // faire gaffe aux possess, visiblement soucis
    }

    function getGearLevel(uint _id) public view returns (uint lvl){
        // levels et calculs  definir
        uint id=findSpecificID(_id);
        if(id==0){
            revert("il n'y a pas dobjet a cet id");
        }
        uint sum= gears[id].stats[0] + gears[id].stats[1]+ gears[id].stats[2]+ gears[id].stats[3]+ gears[id].stats[4];
        if (sum<10){
            return 1;
        } else if (sum<15){
            return 2;
        }else if (sum<25){
            return 3;
        }else if (sum<40){
            return 4;
        }else if (sum<60){
            return 5;
        }else if (sum<85){
            return 6;
        }else if (sum<115){
            return 7;
        }else if (sum<150){
            return 8;
        }
    }

    function craftGearWithGear(uint[] memory _ids) public {
        //faudrait uniquement pouvoir crafter les gear de meme type: boucle for sur les ids et verifier que type=type
        uint gearType;
        uint hp;
        uint attack;
        uint hc;
        uint agility;
        uint def;
        uint[] memory skills; //  a voir
        uint rarity; //  a voir
        string memory urlPng;

        uint goodID;
        for (uint i=0; i<_ids.length; i++){
            goodID=findSpecificID(_ids[i]);
            if(goodID==0){
                revert("il n'y a pas dobjet a cet id");
            }
            hp=hp.add(gears[goodID].stats[0]);
            attack=attack.add(gears[goodID].stats[1]);
            hc=hc.add(gears[goodID].stats[2]);
            agility=agility.add(gears[goodID].stats[3]);
            def=def.add(gears[goodID].stats[4]);
        }

        hp=hp.div(_ids.length);
        attack=attack.div(_ids.length);
        hc=hc.div(_ids.length);
        agility=agility.div(_ids.length);
        def=def.div(_ids.length);

        burnBatchGear(_ids, msg.sender);
        createOneGear ( "craftedGear", gearType,  skills, rarity,  urlPng, hp,  attack, hc, agility, def, msg.sender); // A REVOIR
    }

    function fromSFTtoNft(uint _id, address _newOwner) public {
        uint index= findSpecificID(_id);
        Gear memory gRef=gears[index];

        createOneGear(gRef.name, gRef.gearType, gRef.skills, gRef.rarity, gRef.urlPng, gRef.stats[0], gRef.stats[1], gRef.stats[2], gRef.stats[3], gRef.stats[4], _newOwner);
    
        _burn( _SFT, _categorySFTgear, address(this), 1);
    }

    ///////////////////////
    //// for owners ///////
    ///////////////////////

    function createOneGearOwners(string memory _name, uint _gearType, uint[] memory _skills, uint _rarity, string memory _urlPng, uint _HP, uint _Attack, uint _HC, uint _Agility, uint _Def, address _Owner) public isAllowed(msg.sender) {
        createOneGear(_name, _gearType, _skills, _rarity, _urlPng, _HP, _Attack, _HC, _Agility, _Def, _Owner);
    }

    function createBatchSameGearOwners(string memory _name, uint _gearType, uint[] memory _skills, uint _rarity, string memory _urlPng, uint _HP, uint _Attack, uint _HC, uint _Agility, uint _Def, uint _amount) public isAllowed(msg.sender) returns (uint) {
        uint id = createBatchSameGear(_name, _gearType, _skills, _rarity, _urlPng, _HP, _Attack, _HC, _Agility, _Def, _amount); 
        return id;
    }
}
